import React from "react";

import Navbar from "../../components/navbar";

import Typography from "@material-ui/core/Typography";

class Home extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <Typography>Hello World</Typography>;
      </div>
    );
  }
}

export default Home;
